import React from "react";
import styled from "styled-components";

const MainActivityContainer = styled.div`
  max-width: 1280px;
  height: 683px;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
  display: grid;
  grid-template-columns: 121fr 146fr 927fr 86fr;
  grid-template-rows: 220fr 463fr;
  .MainActivityLeft {
    width: 121px;
    height: 48px;
    grid-column: 1 / span 1;
    grid-row: 1 / span 1;
    font-size: 32px;
    font-family: Kanit;
    font-weight: bold;
    line-height: 48px;
    margin-top: 100px;
  }
  .MainToActivity {
    display: block;
    text-decoration: none;
    font-size: 16px;
    font-family: NanumSquareR;
    line-height: 18px;
    color: #afafaf;
    margin-top: 13px;
  }
  .MainActivityTop {
    grid-column: 3 / span 1;
    grid-row: 1 / span 1;
    width: 267px;
    height: 20px;
    font-family: NanumSquareR;
    font-size: 18px;
    line-height: 34px;
    color: #101010;
    margin-top: 113px;
  }
`;

function MainActivity() {
  return (
    <MainActivityContainer>
      <div className="MainActivityLeft">
        Activity
        <a href="#" className="MainToActivity">
          View Detail -
        </a>
      </div>
      <div className="MainActivityTop">EC에 오면 이런 활동을 할 수 있어요!</div>
      <div className="MainActivityText1"></div>
      <div className="MainActivityText2"></div>
      <div className="MainActivityPhoto"></div>
    </MainActivityContainer>
  );
}

export default MainActivity;
